Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		_parent.移动("右",慢速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",慢速度);
	}
}
function 攻击时四向移动(上, 下, 左, 右)
{
	if (上 != 0)
	{
		_parent.移动("上",上);
	}
	else if (下 != 0)
	{
		_parent.移动("下",下);
	}
	if (左 != 0)
	{
		_parent.方向改变("左");
		_parent.移动("左",左);
	}
	else if (右 != 0)
	{
		_parent.方向改变("右");
		_parent.移动("右",右);
	}
}

//本帧是锁定敌人位置的帧，建议比位移元件早一些。

//你需要改的值，追踪持续帧是从挂载ef的位移元件的第二帧到预计实际到达敌人位置时的总帧数。
速度上限 = _parent.行走X速度 * 3;
追踪持续帧 = 5;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);
速度Z = 速度X * 距离Z / 距离X;

if (速度X >= 0)
{
	左速度 = 速度X;
}
else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = 速度Z;
}
else
{
	下速度 = -速度Z;
}

//本帧是位移元件中间进行锁定敌人位置并二次追踪变向的帧，建议在距离实际出伤至少10帧时使用

//你需要改的值，追踪持续帧是从挂载ef的位移元件的第二帧（已有位移元件则从当前帧）到预计实际到达敌人位置时的总帧数
速度上限 = _parent.行走X速度 * 3;
追踪持续帧 = 11;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);
速度Z = 速度X * 距离Z / 距离X;

if (速度X >= 0)
{
	左速度 = 速度X;
}
else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = 速度Z;
}
else
{
	下速度 = -速度Z;
}

onClipEvent(enterFrame){
   _parent.攻击时移动(25,25);
}

onClipEvent(enterFrame){
   _parent.攻击时四向移动(_parent.上速度, _parent.下速度, _parent.左速度, _parent.右速度);
}

onClipEvent (load) {
    _parent._parent.防御力 = 99000;
}
onClipEvent (unload) {
    _parent._parent.防御力 = _parent._parent.基本防御力;
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 3;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

